import React from 'react';
import { Container } from './styles';
import logo from '../../assets/images/Logo.png';
import { Link } from 'react-router-dom';

function Components() {
  return (
      <Container>
        <Link to="/">
         <img src={logo} alt="lunestore" />
        </Link>
      </Container>
  );
}

export default Components;
